import {Component, OnInit, TemplateRef} from '@angular/core';
import {FormBuilder, FormGroup, Validators} from '@angular/forms';
import {CreateTokenRequest} from '../../models/tokens/createTokenRequest';
import {DataAccessService} from '../../providers/data-access/data-access.service';
import {environment} from '../../../environments/environment';


@Component({
  selector: 'app-token-create',
  templateUrl: './token-create.component.html',
  styleUrls: ['./token-create.component.scss']
})
export class TokenCreateComponent implements OnInit {

  private notificationTimer: any;
  public requestInProgress: boolean;
  public statusMessageError: string;
  public statusMessageSuccess: string;
  public createTokenForm: FormGroup;
  public blockchainModel: string = "Yocoin";
  public blockchainList: any;

  constructor(public formBuilder: FormBuilder,
              private dataAccess: DataAccessService) {

    this.createTokenForm = this.formBuilder.group({
      name: ['', Validators.required],
      blockchain: ['', Validators.required],
      symbol: ['', Validators.required],
      description: ['', Validators.required],
      decimals: ['', Validators.required],
      total: ['', Validators.required],
      icon: ['', Validators.required]
    });


    this.blockchainList = [
      {value: 'Yocoin'},
      {value: 'Ethereum'}
    ];

  }


  ngOnInit() {

  }

  sendCreateTokenReq() {
    this.resetNotifications();
    clearTimeout(this.notificationTimer);
    /*if (!this.createTokenForm.valid) return;*/
    
    
    const createTokenRequest = new CreateTokenRequest();
    createTokenRequest.name = this.createTokenForm.value.name;
    createTokenRequest.blockchain = this.createTokenForm.value.blockchain;
    createTokenRequest.symbol = this.createTokenForm.value.symbol;
    createTokenRequest.description = this.createTokenForm.value.description;
    createTokenRequest.decimals = parseInt(this.createTokenForm.value.decimals);
    createTokenRequest.total = parseInt(this.createTokenForm.value.total);
    //createTokenRequest.icon = this.createTokenForm.value.icon;
    createTokenRequest.icon = "data:image/jpeg;base64,";
    console.log("createTokenRequest = ");
    console.log(createTokenRequest);


    
    this.requestInProgress = true;
    this.dataAccess.postApiRequest(environment.rest_endpoint.createToken, createTokenRequest)
      .finally(() => this.requestInProgress = false)
      .subscribe(data => {
          this.statusMessageSuccess = 'Password has been changed successfully';
          this.notificationTimeout();
          this.createTokenForm.reset();

          Object.keys(this.createTokenForm.controls).forEach(key => {
            this.createTokenForm.controls[key].setErrors(null)
          });
        }, error => {
          if (error.error) {
            this.statusMessageError = error.error.message;
            this.notificationTimeout();
          }
        }
      );
    
    
    
  }


  notificationTimeout() {
    this.notificationTimer = setTimeout(() => this.resetNotifications(), 5000);
  }

  resetNotifications() {
    this.statusMessageError = null;
    this.statusMessageSuccess = null;
  }

  onAvatarChange(event) {
    let reader = new FileReader();
    if (event.target.files && event.target.files.length > 0) {
      let file = event.target.files[0];
      reader.readAsDataURL(file);
      reader.onload = () => {
        console.log("Downloaded file:");
        console.log(file);
        //this.profileService.updateAvatarFile(file);
      };
    }
  }

}


